import './App.css';

class App extends Component {

  render(){
    let route = window.location.pathname;
    var day = new Date();
    return (
      <div className="App">
        <div className="foxhole1"><Navi/></div>
        <div className="foxhole2"><Textbar/></div>
        <div className="foxhole3"><Textcontent route={route}/></div>
      </div>
    );
  }
}

export default App;
